import React from "react";
import { MemoryRouter as Router } from "react-router-dom";
import Flow, { Screen } from "./components/flow";

import Controls from "./components/controls";

const ScreenZero = () => {
  return (<div><h3>Screen Zero</h3></div>);
};

const ScreenOne = () => {
  return <h3>Screen One</h3>;
};

const ScreenTwo = () => {
  return <h3>Screen Two</h3>;
};

const ScreenThree = () => {
  return <h3>Screen Three</h3>;
};

export default function MyFlowSetup() {
  return (
    <Router>
      <Controls />
      <section className="App">
        <Flow>
          <Screen name="screen-zero">
            <ScreenZero />
          </Screen>
          <Screen name="screen-one">
            <ScreenOne />
          </Screen>
          <Screen name="screen-two">
            <ScreenTwo />
          </Screen>
          <Screen name="screen-three">
            <ScreenThree />
          </Screen>
        </Flow>
      </section>
    </Router>
  );
}
